import Navbar from 'react-bootstrap/Navbar';
import Nav from 'react-bootstrap/Nav';
import { Link } from "react-scroll";

const NavBar = () => {
    return (

<Navbar expand="sm" fixed='top'>
  {/* <Navbar.Brand href="#home">EdMiles.tech</Navbar.Brand> */}
  <Link className='nav-links'
            activeClass="active"
            to="homeH1"
            spy={false}
            smooth={true}
            offset={-500}
            duration={1000}
        >EdMiles.tech
    </Link>
        <span className='nav-links-container'>
  <Navbar.Toggle aria-controls="basic-navbar-nav" />
  <Navbar.Collapse id="basic-navbar-nav">
    <Nav className="mr-auto">
        <span className='nav-links'>
        <Link
            activeClass="active"
            to="homeH1"
            spy={false}
            smooth={true}
            offset={-500}
            duration={1000}
        >Home
        </Link>
        </span>
        <span className='nav-links'>
        <Link
            activeClass="active"
            to="projectTabs"
            spy={false}
            smooth={true}
            offset={-100}
            duration={1000}
        >About
        </Link>
        </span>
        <span className='nav-links'>
        <Link
            activeClass="active"
            to="projectTabs"
            spy={false}
            smooth={true}
            offset={-100}
            duration={1000}
        >Skills
        </Link>
        </span>
        <span className='nav-links'>
        <Link
            activeClass="active"
            to="projectTabs"
            spy={false}
            smooth={true}
            offset={-100}
            duration={1000}
        >Projects
        </Link>
        </span>
    </Nav>
  </Navbar.Collapse>
  </span>
</Navbar>


